import React from 'react';
import './Logo.css';

const Logo = () => {
    return (
        <div className="logoContainer">
            <img src="../../assets/images/Scorch_200x100.png" alt="Client's Logo" className="logoImage" />
        </div>
    );
};

export default Logo;
